export default function loiGiais({ ketQua }) {
  return (
    <Grid key={ketQua.id} item xs={12}>
      <Box className={classes.box}>
        <List>
          {/* <ListItem>
            <ListItemIcon>
              <HighlightOffIcon />
            </ListItemIcon>
          </ListItem> */}
          <ListItem>
            <ListItemIcon>
              <LabelIcon />
            </ListItemIcon>
            <ListItemText
              primary={
                <Typography
                  className={classes.cung}
                  //  color="primary"
                  variant="h6"
                >
                  {`Cung ${ketQua.cung.name}`}
                </Typography>
              }
            />
          </ListItem>
        </List>
        {ketQua.loiGiais.map((loiGiai) => {
          let chinhTinhs = loiGiai.chinhTinh
            .map((tinh) => tinh.name)
            .toString();
          let phuTinhs = loiGiai.phuTinh.map((tinh) => tinh.name).toString();

          return (
            <List component="nav" key={loiGiai.id}>
              {chinhTinhs && phuTinhs ? (
                <ListItem>
                  <ListItemIcon>
                    <StarIcon />
                  </ListItemIcon>
                  <ListItemText
                    primary={`Chính tinh ${chinhTinhs}. Phụ Tinh ${phuTinhs}`}
                    secondary={loiGiai.giai}
                  />
                </ListItem>
              ) : chinhTinhs ? (
                <ListItem>
                  <ListItemIcon>
                    <StarIcon />
                  </ListItemIcon>
                  <ListItemText
                    primary={`Chính tinh ${chinhTinhs}`}
                    secondary={loiGiai.giai}
                  />
                </ListItem>
              ) : phuTinhs ? (
                <ListItem>
                  <ListItemIcon>
                    <StarBorderIcon />
                  </ListItemIcon>
                  <ListItemText
                    primary={`Phụ tinh ${phuTinhs}. `}
                    secondary={loiGiai.giai}
                  />
                </ListItem>
              ) : null}
            </List>
          );
        })}
      </Box>
    </Grid>
  );
}
